import React from "react";
import styled from "styled-components";

const Detail = (props) => {
  return <Container>Detail Page</Container>;
};

const Container = styled.div`
  display: block;
  top: 80px;
  overflow-x: hidden;
  position: relative;
  min-height: calc(100vh - 250px);
  padding: 0 calc(3.5vh + 5px);
`;

export default Detail;
